  console.log(count);

  const increaseHamdler = () => {
    setCount((prev) => {
      return [...prev, <li>"this is me"</li>];
    });
  };

  return (
    <div>
      <p>this is counter {count}</p>
      <button onClick={increaseHamdler}>Click me</button>
    </div>
  );
}
export default Example;
